class Stack(object):
    def __init__(self, capacity=0):
    self.items = []
    self.capacity = capacity
    def push(self, item):
    if len(self.items) >= self.capacity:
    raise Exception("Stack is full")
    self.items.append(item)
    def pop(self):
    return self.items.pop()
    def peek(self):
    return self.items[-1]

