def generateRandomPassword(length):
    password = ""
    for i in range(0, length):
        if random.randint(0, 1) == 0:
        password += chr(random.randint(65, 90))
    else:
        password += chr(random.randint(97, 122))
    return password

def fib(n):
    if n == 0 or n == 1:
    return n
    else:
    return fib(n-1) + fib(n-2)

